CREATE TABLE users (`id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT, `first_name` VARCHAR(255)  NULL, `last_name` VARCHAR(255)  NULL, `email` VARCHAR(255)  NULL, `address` VARCHAR(255)  NULL, `contact_no` VARCHAR(255)  NULL, `password` VARCHAR(255)  NULL, `status` VARCHAR(255)  NULL, `role_id` VARCHAR(255)  NULL, `userUpdated` TIMESTAMP  NOT NULL, `userIdentify` VARCHAR(255)  NOT NULL)